import React from 'react';
import { useNavigate } from 'react-router-dom';

const Contact = () => {
  const navigate = useNavigate();
  const goToHome = () => {
    navigate('/');
  };
  return (
    <>
      <h1>My Contact Pge</h1>
      <button onClick={goToHome}>Go to Home Page</button>
      <br />
      <br />
      <button onClick={goback}>Go Back</button>
      // Isse ham previous page par return ho jaayege. Isse aapko pata chal
      jaayega ki aap kis previous page par the. Ye hai Go back functionality in
      simple word
    </>
  );
};

export default Contact;
